import React, { useState } from 'react';
import './App.css';
import Navbar from './components/Navbar';
import EventSlider from './components/EventSlider';
import PopularEvents from './components/PopularEvents/PopularEvents';

function App() {
  return (
    <div className="app">
      <Navbar />
      <EventSlider />
      <PopularEvents />
    </div>
  );
}

export default App;
